import React from 'react'
import Link from 'next/link'

const NavLink=({href,children})=>{
return (
    <Link href={href}>
    <a>Cadastro</a>
</Link>
)

}

const NavBar = () => {
    return (
        <div className='bg-gray-500 py-4'>
        <NavLink href='/sobre'>Sobre</NavLink>
            <Link href='/entrar'>
                <a>Entrar</a>
            </Link>
            <Link href='/sobre'>
                <a>Sobre</a>
            </Link>
        </div>
    )
}
export default NavBar
